import "./new.css";
import main from "../assets/images/main.jpg"
function News(){
    return(
        <div className="new-main-body">
            <div className="img-grp">
                <div className="big-img">
                    <img src={main}></img>
                </div>
                <div>
                    <div></div>
                </div>
            </div>
        </div>
    )
}
export default News;
